import logo from './logo.svg';
import './App.css';

const [todos, setTodos] = useState([
  {
    id : 1,
    text: '리액트 기초 알아보기',
    checked : true,
  },
  {
    id : 2,
    text : '컴포넌트 스타일링 하기',
    checked : true,
  },
  {
    id: 3,
    text: '투두리스트 만들기',
    checked : false,
  },
  ]);

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          인호에게 배우는 react
        </a>
      </header>
    </div>
  );
}

export default App;
